import { GoogleMap, MarkerF, PolygonF, useJsApiLoader } from '@react-google-maps/api';
import React from 'react';

const containerStyle = {
  width: '100%',
  height: '600px',
};

const center = {
  lat: 23.3441,
  lng: 85.3096,
};

// Define coordinates for 10 uneven polygons (P1 to P10) that touch but do not overlap
const districtCoords = [
  [ // P1
    { lat: 23.470, lng: 85.260 },
    { lat: 23.475, lng: 85.260 },
    { lat: 23.475, lng: 85.290 },
    { lat: 23.470, lng: 85.290 },
  ],
  [ // P2
    { lat: 23.470, lng: 85.290 },
    { lat: 23.475, lng: 85.290 },
    { lat: 23.475, lng: 85.320 },
    { lat: 23.470, lng: 85.320 },
  ],
  [ // P3
    { lat: 23.470, lng: 85.320 },
    { lat: 23.475, lng: 85.320 },
    { lat: 23.475, lng: 85.350 },
    { lat: 23.470, lng: 85.350 },
  ],
  [ // P4
    { lat: 23.475, lng: 85.250 },
    { lat: 23.480, lng: 85.250 },
    { lat: 23.480, lng: 85.270 },
    { lat: 23.475, lng: 85.270 },
  ],
  [ // P5
    { lat: 23.475, lng: 85.270 },
    { lat: 23.480, lng: 85.270 },
    { lat: 23.480, lng: 85.290 },
    { lat: 23.475, lng: 85.290 },
  ],
  [ // P6
    { lat: 23.475, lng: 85.290 },
    { lat: 23.480, lng: 85.290 },
    { lat: 23.480, lng: 85.310 },
    { lat: 23.475, lng: 85.310 },
  ],
  [ // P7
    { lat: 23.475, lng: 85.310 },
    { lat: 23.480, lng: 85.310 },
    { lat: 23.480, lng: 85.330 },
    { lat: 23.475, lng: 85.330 },
  ],
  [ // P8
    { lat: 23.460, lng: 85.260 },
    { lat: 23.465, lng: 85.260 },
    { lat: 23.465, lng: 85.290 },
    { lat: 23.460, lng: 85.290 },
  ],
  [ // P9
    { lat: 23.460, lng: 85.290 },
    { lat: 23.465, lng: 85.290 },
    { lat: 23.465, lng: 85.320 },
    { lat: 23.460, lng: 85.320 },
  ],
  [ // P10
    { lat: 23.460, lng: 85.320 },
    { lat: 23.465, lng: 85.320 },
    { lat: 23.465, lng: 85.350 },
    { lat: 23.460, lng: 85.350 },
  ],
];

// Icon positions for each polygon
const iconCoordinates = {
  P1: { lat: 23.472, lng: 85.275 },
  P2: { lat: 23.472, lng: 85.305 },
  P3: { lat: 23.472, lng: 85.335 },
  P4: { lat: 23.477, lng: 85.260 },
  P5: { lat: 23.477, lng: 85.275 },
  P6: { lat: 23.477, lng: 85.295 },
  P7: { lat: 23.477, lng: 85.315 },
  P8: { lat: 23.462, lng: 85.275 },
  P9: { lat: 23.462, lng: 85.305 },
  P10: { lat: 23.462, lng: 85.335 },
};

// URL for the icons to be used in each polygon (placeholder URLs)
const iconUrls = {
  P1: "https://example.com/icon1.png",
  P2: "https://example.com/icon2.png",
  P3: "https://example.com/icon3.png",
  P4: "https://example.com/icon4.png",
  P5: "https://example.com/icon5.png",
  P6: "https://example.com/icon6.png",
  P7: "https://example.com/icon7.png",
  P8: "https://example.com/icon8.png",
  P9: "https://example.com/icon9.png",
  P10: "https://example.com/icon10.png",
};

const MapComponent = () => {
  const { isLoaded } = useJsApiLoader({
    id: 'google-map-script',
    googleMapsApiKey: "AIzaSyChN074R5gt4BfPTFox9UXnND0S8yyH6Dk", // Replace with your Google Maps API key
  });

  return isLoaded ? (
    <GoogleMap mapContainerStyle={containerStyle} center={center} zoom={15}>
      {/* Loop through districtCoords and create Polygons */}
      {districtCoords.map((coords, index) => (
        <PolygonF
          key={index}
          paths={coords}
          options={{
            fillColor: ['#FF0000', '#00FF00', '#0000FF', '#FFFF00', '#FFA500', '#800080', '#008080', '#FFC0CB', '#808080', '#A52A2A'][index],
            strokeColor: '#000000',
            strokeWeight: 2,
            fillOpacity: 0.6,
          }}
        />
      ))}

      {/* Loop through iconCoordinates and add Icons */}
      {Object.entries(iconCoordinates).map(([key, position]) => (
        <MarkerF
          key={key}
          position={position}
          icon={{
            url: iconUrls[key], // Use the corresponding icon for each polygon
            scaledSize: new window.google.maps.Size(32, 32), // Adjust size
          }}
          label={{
            text: key, // Display P1, P2, etc.
            fontSize: '12px',
            color: 'white',
          }}
        />
      ))}
    </GoogleMap>
  ) : <></>;
};

export default MapComponent;
